//import { loadPartialConfig } from "@babel/core";
import React from "react";
import { View, Text } from "react-native";
import { List, Title, ActivityIndicator, FAB, Modal } from "react-native-paper";
import { getFloor } from "./FloorController";
export default class FloorDetails extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      id: null,
      name: null,
    };
  }
  componentDidMount() {
    //console.log("props", this.props);
    getFloor(this.props.route.params.id)
      .then((result) => {
        this.setState(result);
      })
      .catch((err) => {
        console.error(err);
      });
  }
  render() {
    const { name } = this.state;
    return (
      <View>
        <Text>
          <Modal visible={!Boolean(name)}>
            <ActivityIndicator
              animating={!Boolean(name)}
              style={{
                flex: 1,
                alignItems: "center",
                justifyContent: "center",
              }}
            ></ActivityIndicator>
          </Modal>
          <TableView name="name" />
        </Text>
      </View>
    );
  }
}

function TableView(props) {
  const { name } = props;
  return (
    <>
      <Title>{name}</Title>
      <View styles={{ flex: 1, justifyContent: "center" }}>
        <List></List>
        <FAB></FAB>
      </View>
    </>
  );
}
